import React, { Component } from "react";
import Alertdialog from './dialogbox';
import Header from "./header";
import Footer from "./footer";
import Resultfilter from "./result_filter";
import * as LocalConfig from "./local_config";
import $ from "jquery";
import { filterObjectList, rndrSearchResults, rndrPagination} from './util';
import Loadingicon from "./loading_icon";
import Paginator from "./paginator";
import jsonData from "../jsondata/results.json";


class SearchResults extends Component {
  state = {
    filterlist: [],
    pageIdx:1,
    startPageIdx:1,
    dialog:{
      status:false, 
      msg:""
    }
  };

  componentDidMount() {
    this.handleSearch();
  }

  handleKeyPress = (e) => {
    if(e.key === "Enter"){
      e.preventDefault();
      this.handleSearch();
    }
  }


  handleSearch = () => {

  }



   handleSearchOld = () => {

    var queryValue = $("#query").val();
    queryValue = (queryValue === null ? "" : queryValue);
    var reqObj = {coll:"c_bsns", query:queryValue};

    const requestOptions = { 
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(reqObj)
    };
    const svcUrl = LocalConfig.apiHash.get_many;

    fetch(svcUrl, requestOptions)
      .then((res) => res.json())
      .then(
        (result) => {
          var tmpState = this.state;
          tmpState.response = result;
          tmpState.isLoaded = true;          
          if (tmpState.response.status === 0){
            tmpState.dialog.status = true;
            tmpState.dialog.msg = tmpState.response.error;
          }
          this.setState(tmpState);
          //console.log("Request:",svcUrl);
          console.log("Ajax response:", result);
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error,
          });
        }
      );
  }


  handleFilterReset = () => {
    $('input[name="filtervalue"]:checkbox:checked').prop("checked", false);
    this.setState({ filterlist: [] });
  };

  handleFilterApply = () => {
    $("#filtercn").toggle();
    var tmpList = $('input[name="filtervalue"]:checkbox:checked')
      .map(function () {
        return $(this).val();
      })
      .get(); // <----
    this.setState({ filterlist: tmpList });
  };

  handleFilterIcon = () => {
    $("#filtercn").toggle();
  };



  handleDialogClose = () => {
    var tmpState = this.state;
    tmpState.dialog.status = false;
    this.setState(tmpState);
  }


  handlePaginatorClick = (e) => {
    var pageIdx = parseInt(e.target.id.split("_")[1]);
    var tmpState = this.state;
    tmpState.pageIdx = pageIdx;
    this.setState(tmpState);

  }




  render() {


    //if (!("response" in this.state)){
    //    return <Loadingicon/>
    //}
    //const objList = (this.state.response.recordlist === undefined ? [] : this.state.response.recordlist);

    const objList = jsonData.datasets;
    var filObj = filterObjectList(objList, []);
    console.log(objList)

     //var filObj = filterObjectList(objList, this.state.filterlist);
    var filterInfo = filObj.filterinfo;
    var passedObjList = filObj.passedobjlist;

    var batchSize = 20;
    var pageCount = parseInt(passedObjList.length/batchSize);
    var startIdx = batchSize * (this.state.pageIdx - 1) + 1;
    var endIdx = startIdx + batchSize;

    var pageBatchSize = 5;
    var endPageIdx = this.state.startPageIdx  + pageBatchSize;



    var resultSummary = passedObjList.length + " Results";


   //return (<div>{passedObjList.length}</div>);

    return (
      <div>
      <Header />
      <div className="pagecn">
        <Alertdialog dialog={this.state.dialog} onClose={this.handleDialogClose}/>


        <Resultfilter
          filterinfo={filterInfo}
          resultcount={objList.length}
          resultSummary={resultSummary}
          handleSearchIcon={this.handleSearchIcon}
          handleFilterIcon={this.handleFilterIcon}
          handleFilterApply={this.handleFilterApply}
          handleFilterReset={this.handleFilterReset}
        />

        <div className="leftblock" 
          style={{width:"100%", margin:"60px 0px 0px 0px",
          borderBottom:"1px solid #ccc"}}>
          <Paginator 
            startPageIdx={startPageIdx}
            endPageIdx={endPageIdx}
            onClick={this.handlePaginatorClick}
          />
        </div>

        <div className="leftblock" 
          style={{margin:"20px 0px 0px 0px"}}>
          {rndrSearchResults(passedObjList, startIdx, endIdx)}
        </div>

        <div className="leftblock" 
          style={{width:"100%", 
          margin:"0px 0px 0px 0px",
          padding:"5px 0px 0px 0px",
          borderTop:"1px solid #ccc"}}>
          <Paginator 
            startPageIdx={startPageIdx}
            endPageIdx={endPageIdx}
            onClick={this.handlePaginatorClick}
          />
        </div>

      </div>
      <Footer />
      </div>
    );
  }
}

export default SearchResults;
